import React from "react";

const range = props => (
    <div className="form-group m-0 w-100">
        <input 
        className="custom-range"
        type="range"
        onChange={props.onChange}
        min={props.min || 0}
        max={props.max || 100}
        step={props.step || 1}/>
    </div>
);


export default range;
